import React, { Component } from "react";

import {
  Card,
  Icon,
  Avatar,
  Row,
  Col,
  Drawer,
  Button,
  Input,
  InputNumber,
  Select
} from "antd";

const { Meta } = Card;
const { Option } = Select;

export default class Order extends Component {
  state = {
    data: [
      {
        id: 1,
        table_number: 1,
        url:
          "https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png",
        title: "Alex",
        description: ["burger,", "cheese,", "free"]
      },
      {
        id: 2,
        table_number: 2,
        url:
          "https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png",
        title: "Martin",
        description: ["burger,", "cheese,", "free"]
      },
      {
        id: 3,
        table_number: 3,
        url:
          "https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png",
        title: "John",
        description: ["burger,", "cheese,", "free"]
      },
      {
        id: 4,
        table_number: 4,
        url:
          "https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png",
        title: "Maria",
        description: ["burger,", "cheese,", "free"]
      },
      {
        id: 5,
        table_number: 5,
        url:
          "https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png",
        title: "Luci",
        description: ["burger,", "cheese,", "free"]
      },
      {
        id: 6,
        table_number: 6,
        url:
          "https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png",
        title: "Isabel",
        description: ["burger,", "cheese,", "free"]
      }
    ],
    visible: false
  };

  showDrawer = () => {
    this.setState({ visible: true });
  };

  onClose = () => {
    this.setState({
      visible: false
    });
  };
  handleDelete = dataId => {
    const data = this.state.data.filter(item => item.id !== dataId);
    this.setState({ data: data });
  };
  render() {
    const { data } = this.state;
    return (
      <div
        style={{
          background: "#fff",
          padding: 24,
          minHeight: 680
        }}
      >
        <Row>
          <Button type="primary" onClick={this.showDrawer}>
            <Icon type="plus" />
            Add new Order
          </Button>
        </Row>
        <Drawer
          title="Add new Order"
          width={520}
          onClose={this.onClose}
          visible={this.state.visible}
          bodyStyle={{ paddingBottom: 80 }}
        >
          <Row gutter={[40, 20]}>
            <Col span={10}>
              <InputNumber
                placeholder="Enter table number"
                style={{ width: "200px" }}
              />
            </Col>
            <Col span={10}>
              <Input placeholder="Enter customer name" />
            </Col>
          </Row>
          <Row gutter={[20, 20]}>
            <Col span={10}>
              <Select
                mode="multiple"
                style={{ width: "100%" }}
                placeholder="Order"
                // onChange={handleChange}
                optionLabelProp="label"
              >
                <Option value="burger" label="burger">
                  burger
                </Option>
                <Option value="cheese" label="Cheese">
                  Cheese
                </Option>
                <Option value="FrenchFree" label="FrenchFree">
                  FrenchFree
                </Option>
              </Select>
            </Col>
          </Row>
          <Row>
            <Col offset={2}>
              <Button style={{ width: "400px" }} type="primary">
                Order
              </Button>
            </Col>
          </Row>
        </Drawer>
        <Row gutter={2}>
          {data.map(a => (
            <Col span={6}>
              <Card
                key={a.id}
                id={a.id}
                style={{ width: 300, margin: "2em 2em" }}
                title={a.table_number}
                cover={<img alt="" src={a.url} />}
                actions={[
                  <Icon type="delete" onClick={() => this.handleDelete(a.id)} />
                ]}
              >
                <Meta
                  avatar={<Avatar>{a.title}</Avatar>}
                  title={a.title}
                  description={a.description}
                />
              </Card>
            </Col>
          ))}
        </Row>
      </div>
    );
  }
}
